import React from 'react'
import './App.css'
import { Switch,Route } from 'react-router-dom';
import Homepage from './pages/Homepage';


const HatsPage = () =>(
  <div>
    <h1>HatsPage here</h1>
  </div>
)

const TopicList = () =>(
  <div>
    <h1>TopicList here</h1>
  </div>
)

const TopicDetail = () =>(
  <div>
    <h1>TopicDetail here</h1>
  </div>
)

function App () {
  return(
    <div>
      <Switch>
        <Route exact path="/" component={Homepage} />
        <Route path="/hats" component={HatsPage} />
      </Switch>
    </div>
  )
}


export default App;
